    @Override
    public List<Float> getEmbeddings(String prompt) {
        try {
            OllamaEmbedResponseModel embeddings = ollamaAPI.embed("nomic-embed-text", Arrays.asList(prompt));
            List<Double> doubleList = embeddings.getEmbeddings().get(0);
            List<Float> floatList = new ArrayList<>();
            for (Double d : doubleList) {
                floatList.add(d.floatValue());
            }
            return floatList;
        }catch (IOException e){
            System.out.println(e.getMessage());
        }catch (OllamaBaseException e) {
            System.out.println(e.getMessage());
        }catch (InterruptedException e) {
            System.out.println(e.getMessage());
        }
        return new ArrayList<>();
    }

    @Override
    public String think(String prompt) {
        try {
            OllamaResult result = ollamaAPI.generate("qwen2.5:32b-instruct",
                    prompt, false, new OptionsBuilder().setNumCtx(8000).build());
            return result.getResponse();
        } catch (OllamaBaseException e) {
            System.out.println("OllamaBaseException: " + e.getMessage());
        } catch (IOException e) {
            System.out.println("IOException: " + e.getMessage());
        } catch (InterruptedException e) {
            System.out.println("InterruptedException: " + e.getMessage());
        }
        return "";
    }
